import * as checkers from "./checkers";

let prevState; 
export default class Observer{
    constructor(store){
        this.store = store;
    }

    check(){
        let state = this.store.getState().console;
        for( let [key, fun, what] in checkers){
            console.log("iterate", key , fun, what)
        }
        console.log(checkers);
        prevState = state;
    }  
}
